// import 'react-whatsapp-widget/dist/index.css'

function App() {

  return (
    <Router basename={"/"}>
      {/* <ScrollToTop> */}
        <Switch>
          <Route exact path={`${process.env.PUBLIC_URL}/`} component={KinderGarden} />
